script: |
  super -f tsv -I q6339.sql | sort > q6339.out

vector: true

inputs:
  - name: q6339.sql
    data: |
      SELECT ALL 95 AS col2, + 25 FROM tab1 WHERE + + col1 + ( + col2 ) + ( - col1 ) * + + 72 * 89 IS NOT NULL;
  - name: tab1

outputs:
  - name: q6339.out
    data: |
      95	25
      95	25
      95	25
